CREATE FUNCTION sch_ecole.creation_ecole() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
DECLARE 
    v_last_ecole_code BIGINT;
BEGIN
    -- Recuperer le dernier code generé pour une ecole de la localité 
    SELECT CAST(e.code AS BIGINT) INTO v_last_ecole_code
    FROM sch_ecole.ecole e 
    WHERE e.localite_code LIKE NEW.localite_code 
    ORDER BY e.code DESC 
    LIMIT 1;

    -- Verifier si le v_last_ecole_code est nul donc il s'agit dune nouvelle ecole sinon on incremente le dernier code.
    IF v_last_ecole_code IS NULL THEN
        NEW.code := '0001';
    ELSE
        NEW.code := LPAD((v_last_ecole_code + 1)::TEXT, 4, '0');
    END IF;

    RETURN NEW;
END;
$$;


