CREATE FUNCTION sch_ecole.creation_tmp_ecole() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
DECLARE 
    v_localite_code VARCHAR;
BEGIN 
    
    -- Recuperer le code de la localité et l'ajouter à la nouvelle ligne d'insertion    
    SELECT LEFT(l.code, 9) INTO v_localite_code
    FROM sch_referentiel.localite l 
    WHERE l.id = NEW.localite_id;

    NEW.localite_code := v_localite_code;

    RETURN NEW;
END;
$$;


