CREATE FUNCTION sch_process.affectation_personnel(p_ecole_id integer, p_matricule character varying, whodone character varying) RETURNS character varying
    LANGUAGE plpgsql
    AS $$
DECLARE
    ecole_existe boolean;
    code_affectation_existe boolean;
    concat_code_affectation VARCHAR;
    matricule_existe boolean;
BEGIN


    IF p_ecole_id IS NULL OR p_matricule IS NULL THEN
        RAISE EXCEPTION 'Echec de l''opération d''affectation: Ecole ou Personnel non disponible.';
	END IF;

	SELECT INTO ecole_existe
    EXISTS(SELECT * FROM sch_ecole.ecole WHERE id = p_ecole_id);

    IF NOT ecole_existe THEN
		RAISE EXCEPTION 'Echec de l''opération d''affectation:Ecole non disponible.';
	END IF;

	SELECT INTO matricule_existe
    EXISTS(SELECT * FROM sch_ecole.personnel WHERE matricule = p_matricule);

    IF NOT matricule_existe THEN
		RAISE EXCEPTION 'Echec de l''opération d''affectation: Personnel non disponible.';
	END IF;

    concat_code_affectation:= p_matricule || p_ecole_id;

    SELECT INTO code_affectation_existe
    EXISTS(SELECT * FROM sch_ecole.affectation WHERE code_affectation = concat_code_affectation);

    IF code_affectation_existe THEN
            RAISE EXCEPTION 'Echec de l''opération d''affectation: Personnel déja affecté au niveau de cette école.';
    END IF;


	RETURN 'OK';
END;
$$;


