--

CREATE FUNCTION sch_process.reception_dotation_materiel_pour_ecole(p_ecole_id integer, p_w_owner character varying) RETURNS character varying
    LANGUAGE plpgsql
    AS $$
DECLARE
    dotation_materiel_existe BOOLEAN;
    r RECORD;
BEGIN
    IF p_ecole_id IS NULL OR p_w_owner IS NULL THEN
        RAISE EXCEPTION 'Echec de l''opération de validation, paramètre d''appel erroné';
    END IF;

    SELECT INTO dotation_materiel_existe
        EXISTS(SELECT 1 FROM sch_ecole.dpe_materiel WHERE ecole_id = p_ecole_id AND statut = 'validated');

    IF NOT dotation_materiel_existe THEN
        RAISE EXCEPTION 'Echec de l''opération de réception de la dotation de matériel : aucune donnée trouvée.';
    END IF;

    UPDATE sch_ecole.dpe_materiel
    SET statut = 'acquired'
    WHERE ecole_id = p_ecole_id AND statut = 'validated';

    SELECT type_materiel_id, ecole_id, nombre, statut, who_done, w_owner
    FROM sch_ecole.dpe_materiel
    WHERE ecole_id = p_ecole_id AND statut = 'acquired';

    FOR r IN
        SELECT * FROM sch_ecole.dpe_materiel
        WHERE ecole_id = p_ecole_id AND statut = 'acquired'
    LOOP
        --  Mise à jour des nombres disponibles et besoins (+/- sans jamais aller en dessous de zéro)
        UPDATE sch_ecole.info_materiel
        SET nombre_besoin = GREATEST(nombre_besoin - r.nombre, 0),
            nombre_disponible = nombre_disponible + r.nombre,
            last_update = CURRENT_TIMESTAMP
        WHERE ecole_id = r.ecole_id AND type_materiel_id = r.type_materiel_id
              AND statut = 'validated';
    END LOOP;

    DELETE FROM sch_ecole.dpe_materiel
    WHERE ecole_id = p_ecole_id AND statut = 'acquired';

    RETURN 'OK';
END;
$$;


