CREATE FUNCTION sch_process.rejet_besoin_personnel(p_ecole_id integer, p_from_profil character varying) RETURNS character varying
    LANGUAGE plpgsql
    AS $$
DECLARE
    v_localite_code VARCHAR;
BEGIN

    IF p_ecole_id IS NULL OR p_from_profil IS NULL THEN
        RAISE EXCEPTION '{{besoin_personnel.rejet.params}}';
	END IF;

	SELECT e.localite_code INTO v_localite_code
    FROM sch_ecole.b_personnel bpe, sch_ecole.ecole e
	WHERE bpe.id_ecole = e.id AND e.id = p_ecole_id AND bpe.statut = 'submitted'
	LIMIT 1;

    IF v_localite_code IS NULL THEN
		RAISE EXCEPTION '{{besoin_personnel.rejet.besoin_personnel_not_exist}}';
	ELSE
		UPDATE sch_ecole.b_personnel
		SET statut = 'rejected', who_done = p_from_profil
		WHERE id_ecole = p_ecole_id AND statut = 'submitted';
	END IF;
	RETURN 'OK';
END;
$$;


