--

CREATE FUNCTION sch_process.rejet_creation_ecole(p_ecole_id integer, p_w_owner_email character varying, p_commentaire character varying) RETURNS character varying
    LANGUAGE plpgsql
    AS $$
DECLARE 
    v_w_owner_profil VARCHAR;
    v_localite_code VARCHAR;
    v_from_profil VARCHAR;
BEGIN 
    
    IF p_ecole_id IS NULL OR p_w_owner_email IS NULL OR p_commentaire IS NULL THEN
        RAISE EXCEPTION '{{ecole.rejet.params}}';  
	END IF;

	-- Vérifier si l'école existe dans la table temporaire
	SELECT localite_code, w_owner  INTO v_localite_code, v_w_owner_profil
    FROM sch_ecole.tmp_ecole WHERE id = p_ecole_id AND statut = 'submitted';

	IF v_localite_code IS NULL OR v_w_owner_profil IS NULL THEN 
		RAISE EXCEPTION '{{ecole.rejet.ecole_not_exist}}';  
	END IF;

	-- Vérifier si le user peut valider la création de l'école
	SELECT recipient_profil INTO v_from_profil
	FROM sch_workflow.v_workflow
	WHERE recipient_email = p_w_owner_email AND context = 'VALIDATION_CREATION_ECOLE' AND v_localite_code LIKE autorisation AND statut = true;

	IF v_from_profil IS NULL OR NOT v_from_profil = v_w_owner_profil THEN 
		RAISE EXCEPTION '{{ecole.rejet.user_not_autorize}}';  
	END IF;

	UPDATE sch_ecole.tmp_ecole
	SET statut = 'rejected', w_owner = p_w_owner_email, commentaire = p_commentaire
	WHERE id = p_ecole_id;
	
	RETURN 'OK';
END;
$$;


