CREATE FUNCTION sch_process.soumission_creation_ecole(p_ecole_id integer, p_from_profil character varying) RETURNS character varying
    LANGUAGE plpgsql
    AS $$
DECLARE 
    v_w_owner_profil VARCHAR;
    v_localite_code VARCHAR;
BEGIN 
    -- Vérifier si les paramètres d'entrée sont valides
    IF P_ecole_id IS NULL OR p_from_profil IS NULL THEN
        RAISE EXCEPTION '{{ecole.soumission.params}}';  
	END IF;
	
	-- Vérifier si l'école existe dans la table temporaire
	SELECT localite_code INTO v_localite_code
    FROM sch_ecole.tmp_ecole WHERE id = P_ecole_id AND statut = 'draft';

	IF v_localite_code IS NULL THEN 
		RAISE EXCEPTION '{{ecole.soumission.ecole_not_exist}}';  
	END IF;

	-- Vérifier si le profil du responsable de la validation existe
	SELECT recipient_profil INTO v_w_owner_profil
	FROM sch_workflow.v_workflow
	WHERE from_profil = p_from_profil AND context = 'VALIDATION_CREATION_ECOLE' AND v_localite_code LIKE autorisation AND statut = true;

	IF v_w_owner_profil IS NULL THEN 
		RAISE EXCEPTION '{{ecole.soumission.w_owner_not_exist}}';  
	END IF;

	-- Mettre à jour le statut et le profil du responsable de la validation de l'école dans la table temporaire
	IF v_w_owner_profil = 'finish' THEN 
		UPDATE sch_ecole.tmp_ecole
		SET statut = 'submitted', w_owner = p_from_profil
		WHERE id = P_ecole_id;
	ELSE 
		UPDATE sch_ecole.tmp_ecole
		SET statut = 'submitted', w_owner = v_w_owner_profil
		WHERE id = P_ecole_id;
	END IF;
		
	RETURN 'OK';
END;
$$;


