--
-- Name: validation_creation_batiment_ecole(integer, character varying); Type: FUNCTION; Schema: sch_process; Owner: postgres
--

CREATE FUNCTION sch_process.validation_creation_batiment_ecole(p_id_ecole integer, w_owner character varying) RETURNS character varying
    LANGUAGE plpgsql
    AS $$
    DECLARE
        ecole_valide boolean;
        batiment_valide boolean;
        tmp_batiment_valide boolean;
    BEGIN
        IF p_id_ecole IS NULL OR w_owner IS NULL THEN
            RAISE EXCEPTION 'Echec de l''opération de validation des batiments créés pour cette ecole, paramètre d''appel erroné';
        END IF;

        SELECT INTO ecole_valide
        EXISTS(SELECT * FROM sch_ecole.tmp_batiment WHERE ecole_id = p_id_ecole AND statut = 'submitted');

        IF NOT ecole_valide THEN
            RAISE EXCEPTION 'Echec de l''opération de validation des batiments créés pour cette ecole, car l''école non trouvée.';
        END IF;

        SELECT INTO batiment_valide
        EXISTS(SELECT * FROM sch_ecole.batiment WHERE ecole_id = p_id_ecole AND statut = 'validate');

        IF batiment_valide THEN
            DELETE FROM sch_ecole.batiment WHERE ecole_id = p_id_ecole AND statut = 'validate';
            SELECT * FROM sch_ecole.tmp_batiment WHERE ecole_id = p_id_ecole AND statut = 'submitted';
        ELSE
            SELECT * FROM sch_ecole.tmp_batiment WHERE ecole_id = p_id_ecole AND statut = 'submitted';
        END IF;

        UPDATE sch_ecole.batiment
        SET statut = 'validate'
        WHERE ecole_id = p_id_ecole AND statut = 'submitted';

        DELETE FROM sch_ecole.tmp_batiment
        WHERE ecole_id = p_id_ecole AND statut = 'submitted';

        RETURN 'OK';
    END;
$$;


