    	WHERE localite_code = p_localite_code AND statut = 'submitted';

    	SELECT t.type_materiel_id, t.localite_code, t.nombre, t.statut, t.who_done, t.w_owner
        FROM sch_ecole.dpl_materiel t WHERE t.localite_code = p_localite_code AND statut = 'validated';

	DELETE FROM sch_ecole.tmp_dpl_materiel
	WHERE localite_code = p_localite_code AND statut = 'submitted';

	RETURN 'OK';

END;
$$;


