--
-- Name: validation_incident_batiment(integer, character varying); Type: FUNCTION; Schema: sch_process; Owner: postgres
--

CREATE FUNCTION sch_process.validation_incident_batiment(p_id_ecole integer, w_owner character varying) RETURNS character varying
    LANGUAGE plpgsql
    AS $$
    DECLARE
        ecole_valide boolean;
    BEGIN
        IF p_id_ecole IS NULL THEN
                RAISE EXCEPTION 'Echec de l''opération de validation de l''incident pour ce batiment, paramètre d''appel erroné';
        END IF;

        SELECT INTO ecole_valide
        EXISTS(SELECT * FROM sch_ecole.incident WHERE ecole_id = p_id_ecole);

        IF NOT ecole_valide THEN
            RAISE EXCEPTION 'Echec de l''opération de validation de l''incident, car ecole non trouvée.';
        END IF;

        UPDATE sch_ecole.incident
        SET statut = 'validate'
        WHERE ecole_id = p_id_ecole AND statut = 'submitted';

        RETURN 'OK';
    END;
$$;


ALTER FUNCTION sch_process.validation_incident_batiment(p_id_ecole integer, w_owner character varying) OWNER TO postgres;

--
-- Name: validation_info_batiment(integer, character varying, character varying); Type: FUNCTION; Schema: sch_process; Owner: postgres
--

CREATE FUNCTION sch_process.validation_info_batiment(p_ecole_id integer, p_periode character varying, p_w_owner_email character varying) RETURNS character varying
    LANGUAGE plpgsql
    AS $$
DECLARE 
	v_w_owner_profil VARCHAR;
    v_localite_code VARCHAR;
    v_from_profil VARCHAR;
    v_batiment_id INT;
    v_new_batiment_id INT;
BEGIN 

    IF p_ecole_id IS NULL OR p_w_owner_email IS NULL OR p_periode IS NULL THEN
        RAISE EXCEPTION '{{info_batiment.validation.params}}';  
	END IF;

	SELECT e.localite_code, ib.w_owner INTO v_localite_code, v_w_owner_profil
    FROM sch_ecole.tmp_info_batiment ib, sch_ecole.ecole e
	WHERE ib.ecole_id = e.id AND e.id = p_ecole_id AND ib.statut = 'submitted' AND periode = p_periode
	LIMIT 1;

    IF v_localite_code IS NULL OR v_w_owner_profil IS NULL THEN 
		RAISE EXCEPTION '{{info_batiment.validation.info_batiment_not_exist}}';  
	END IF;

	-- Vérifier si le user peut valider
	SELECT recipient_profil INTO v_from_profil
	FROM sch_workflow.v_workflow
	WHERE recipient_email = p_w_owner_email AND context = 'VALIDATION_INFRASTRUCTURE' AND v_localite_code LIKE autorisation AND statut = true;

	IF v_from_profil IS NULL OR NOT v_from_profil = v_w_owner_profil THEN 
		RAISE EXCEPTION '{{info_batiment.validation.user_not_autorize}}';  
	END IF;

    -- Parcours des bâtiments soumis
    FOR v_batiment_id IN
        SELECT id
        FROM sch_ecole.tmp_info_batiment
        WHERE ecole_id = p_ecole_id AND statut = 'submitted' AND periode = p_periode AND w_owner = v_w_owner_profil
    LOOP
        -- Insertion dans info_batiment
        SELECT type_batiment_id, nombre_besoin, periode, ecole_id, 'validated', who_done, p_w_owner_email
        FROM sch_ecole.tmp_info_batiment
        WHERE id = v_batiment_id
        RETURNING id INTO v_new_batiment_id;

        -- Insertion des détails liés
        SELECT v_new_batiment_id, type_matiere_id, nombre_disponible, who_done, w_owner
        FROM sch_ecole.tmp_info_batiment_details
        WHERE info_batiment_id = v_batiment_id;

        -- Suppression des détails temporaires
        DELETE FROM sch_ecole.tmp_info_batiment_details
        WHERE info_batiment_id = v_batiment_id;

        -- Suppression du bâtiment temporaire
        DELETE FROM sch_ecole.tmp_info_batiment
        WHERE id = v_batiment_id;
    END LOOP;

	RETURN 'OK';	
END;
$$;


ALTER FUNCTION sch_process.validation_info_batiment(p_ecole_id integer, p_periode character varying, p_w_owner_email character varying) OWNER TO postgres;

--
-- Name: validation_info_eleve(integer, character varying, character varying); Type: FUNCTION; Schema: sch_process; Owner: postgres
