CREATE FUNCTION sch_process.validation_info_eleve(p_ecole_id integer, p_stade character varying, p_w_owner_email character varying) RETURNS character varying
    LANGUAGE plpgsql
    AS $$
DECLARE 
	v_w_owner_profil VARCHAR;
    v_localite_code VARCHAR;
    v_from_profil VARCHAR;
BEGIN 

    IF p_ecole_id IS NULL OR p_w_owner_email IS NULL OR p_stade IS NULL THEN
