--
-- Name: validation_info_materiel(integer, character varying); Type: FUNCTION; Schema: sch_process; Owner: postgres
--

CREATE FUNCTION sch_process.validation_info_materiel(p_ecole_id integer, p_w_owner character varying) RETURNS character varying
    LANGUAGE plpgsql
    AS $$
DECLARE
    info_materiel_existe BOOLEAN;
    tmp_info_materiel_existe BOOLEAN;
BEGIN

    IF p_ecole_id IS NULL OR p_w_owner IS NULL THEN
        RAISE EXCEPTION 'Echec de l''opération de validation, paramètre d''appel erroné';
	END IF;

    -- verifier si table.w_owner == p_w_owner
	SELECT INTO tmp_info_materiel_existe
    EXISTS(SELECT * FROM sch_ecole.tmp_info_materiel WHERE ecole_id = p_ecole_id AND statut = 'submitted');

    IF NOT tmp_info_materiel_existe THEN
		RAISE EXCEPTION 'Echec de l''opération de validation des informations de materiel, car ces informations n''ont pas été trouvées.';
	END IF;

	SELECT INTO info_materiel_existe
	EXISTS(SELECT * FROM sch_ecole.info_materiel where ecole_id = p_ecole_id AND statut = 'validated');

    IF info_materiel_existe THEN
        DELETE FROM sch_ecole.info_materiel where ecole_id = p_ecole_id AND statut = 'validated';
        SELECT * FROM sch_ecole.tmp_info_materiel WHERE ecole_id = p_ecole_id AND statut = 'submitted';
    ELSE
    	SELECT * FROM sch_ecole.tmp_info_materiel WHERE ecole_id = p_ecole_id AND statut = 'submitted';
    END IF;

    UPDATE sch_ecole.info_materiel
        SET statut = 'validated'
        WHERE ecole_id = p_ecole_id AND statut = 'submitted';

    DELETE FROM sch_ecole.tmp_info_materiel
	    WHERE ecole_id = p_ecole_id AND statut = 'submitted';

	RETURN 'OK';

END;
$$;


ALTER FUNCTION sch_process.validation_info_materiel(p_ecole_id integer, p_w_owner character varying) OWNER TO postgres;

--
-- Name: has_permission(text, text); Type: FUNCTION; Schema: sch_referentiel; Owner: postgres
--

CREATE FUNCTION sch_referentiel.has_permission(p_profils text, p_permission text) RETURNS boolean
    LANGUAGE plpgsql
    AS $$
DECLARE
    profils_array TEXT[];
    result BOOLEAN;
BEGIN

    -- Vérifier les paramètres
    IF P_profils IS NULL OR P_permission IS NULL THEN
        RAISE EXCEPTION 'Échec de la vérification des permissions : paramètres invalides.';
    END IF;

    -- Convertir la chaîne en tableau si elle contient plusieurs profils séparés par des virgules
    profils_array := string_to_array(P_profils, ',');

    -- Vérification d'existence
    SELECT EXISTS (
        SELECT 1 
        FROM sch_referentiel.v_autorisation
        WHERE profil = ANY (profils_array) AND permission = P_permission
    ) INTO result;

    RETURN result;
END;
$$;


