--
-- Name: v_localite; Type: VIEW; Schema: sch_referentiel; Owner: postgres
--

CREATE VIEW sch_referentiel.v_localite AS
 SELECT l.id,
    l.code,
    tl.nom AS type_localite,
    tl.niveau,
        CASE tl.niveau
            WHEN 3 THEN (concat(l.designation, ', ', COALESCE(region.designation, '--'::character varying)))::character varying
            WHEN 4 THEN (concat(l.designation, ', ', COALESCE(departement.designation, '--'::character varying), ', ', COALESCE(region.designation, '--'::character varying)))::character varying
            WHEN 5 THEN (concat(l.designation, ', ', COALESCE(commune.designation, '--'::character varying), ', ', COALESCE(departement.designation, '--'::character varying), ', ', COALESCE(region.designation, 'Inconnu'::character varying)))::character varying
            ELSE l.designation
        END AS designation,
    l.who_done,
    l.when_done,
    l.last_update
   FROM ((((sch_referentiel.localite l
     JOIN sch_referentiel.type_localite tl ON ((l.type_localite_id = tl.id)))
     LEFT JOIN sch_referentiel.localite region ON (((region.code)::text = concat(SUBSTRING(l.code FROM 1 FOR 5), '0000000'))))
     LEFT JOIN sch_referentiel.localite departement ON (((departement.code)::text = concat(SUBSTRING(l.code FROM 1 FOR 7), '00000'))))
     LEFT JOIN sch_referentiel.localite commune ON (((commune.code)::text = concat(SUBSTRING(l.code FROM 1 FOR 9), '000'))));


ALTER VIEW sch_referentiel.v_localite OWNER TO postgres;

--
-- Name: sum_info_batiment_localite; Type: VIEW; Schema: sch_ecole; Owner: postgres
--

CREATE VIEW sch_ecole.sum_info_batiment_localite AS
 SELECT l.code AS localite_code,
    l.designation AS localite_nom,
    l.niveau AS localite_niveau,
    ib.type_batiment_id,
    ib.type_batiment_libelle,
    ib.statut,
    ib.periode,
    sum(COALESCE(ib.nombre_disponible, (0)::bigint)) AS nombre_disponible,
    sum(COALESCE(ib.nombre_besoin, 0)) AS nombre_besoin
   FROM (sch_referentiel.v_localite l
     JOIN sch_ecole.v_info_batiment ib ON (
        CASE
            WHEN (l.niveau = 1) THEN (SUBSTRING(l.code FROM 1 FOR 3) = SUBSTRING(ib.localite_code FROM 1 FOR 3))
            WHEN (l.niveau = 2) THEN (SUBSTRING(l.code FROM 1 FOR 5) = SUBSTRING(ib.localite_code FROM 1 FOR 5))
            WHEN (l.niveau = 3) THEN (SUBSTRING(l.code FROM 1 FOR 7) = SUBSTRING(ib.localite_code FROM 1 FOR 7))
            WHEN (l.niveau = 4) THEN (SUBSTRING(l.code FROM 1 FOR 9) = SUBSTRING(ib.localite_code FROM 1 FOR 9))
            ELSE false
        END))
  WHERE ((l.code)::text ~~ '%000'::text)
  GROUP BY l.code, l.designation, l.niveau, ib.type_batiment_id, ib.type_batiment_libelle, ib.statut, ib.periode;


